import Got1 from './images/Got1.png';
import Got2 from './images/Got2.png';
import Got3 from './images/Got3.png';
export const Data = [
  {
    id: 1,
    name: "Category Name",
    img: Got1,
  },
  {
    id: 2,
    name: "Category Name",
    img: Got2,
  },
  {
    id: 3,
    name: "Category Name",
    img: Got3,
  },
];
